import React from "react";
import CarouselCardsComponent from "../Components/CarouselCardsComponent/CarouselCardsComponent";
import NavbarComponent from "../Components/Shared/NavbarComponent/NavbarComponent";

function Home() {
  return (
    <div>
      <NavbarComponent />
      <CarouselCardsComponent />
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    isLoading: state.mostPopularMovies,
    mostPopularMovies: state.mostPopularMovies.mostPopularMovies,
  };
};

const mapDispatchToProps = (dispatch) => ({
  getAnalyticsStudios: () => dispatch(getAnalyticsStudios()),
});

export default connect(mapStateToProps, mapDispatchToProps)(Home);
